import React from "react";
import Card from "./Card.jsx";
import sdata from "./Sdata.jsx";

function ncards(val){
return(<>

<Card 
key={val.id}
    src={val.src}
    title={val.title}
    details={val.details}

/>
</>

);
}
 const App =() =>{
     return(
         <>
             {sdata.map(ncards)}
         </>
     );
    
 }

 export default App
